perspectives.style:
@controls {
 bottom {
 filter {
 target: element;
 by: "element type";
 as: buttons;
 multiple: true;
 default: show-all;
 }
 }
}

@settings {
 template: systems;
 direct-decorations: false;
}

element["shape"="Date"] {
 shape: circle;
 font-style: bold;
}

element["shape"="Event"] {
 shape: circle;
 text-overflow: auto 8;
}

element["shape"="Sport England"] {
 shape: pill;
 size: auto;
 min-width: 2050;
 text-overflow: auto 15;
}

element["shape"="Future planned events"] {
 shape: hexagon;
}

element["shape"="So What"] {
 shape: pill;
 size: auto;
 min-width: 150;
 text-overflow: auto 15;
}

/* Deliverable 1 - Governance */
element["category"="Deliverable 1 - governance"] {
 color: #487bba;
 font-color: white;
}

/* Deliverables 2 & 4 - Engagement and events */
element["category"="Larger community events"] {
 color: #f67c49;
}

element["category"="Date"] {
 color: #dedede;
}

/* Deliverable 3 - Resident activities */
element["category"="Deliverable 3"] {
 color: #fdc16f;
}

/* Wider stakeholders */
element["category"="Wider stakeholders"] {
 color: #e0edf9;
}

/* Core team */
element["category"="Core project team"] {
 color: #74c89e;
}

/* Impact */
element["category"="So What"] {
 color: #6446a0;
 font-color: white;
}

/* Ripple Effect Mapping */
element["category"="REM"] {
 color: #93560d;
 font-color: white;
}

/* Preliminary work */
element["category"="Prep"] {
 color: #f2f2f2;
}
